CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_psel_inventario`(
       IN pCodloc VARCHAR(2),
          pCodpro VARCHAR(3),
          pCodart VARCHAR(4),
          pCodcol VARCHAR(2),
          pTalla VARCHAR(3))
BEGIN

DECLARE Codloc_w VARCHAR(2);
DECLARE Codpro_w VARCHAR(3);
DECLARE Codart_w VARCHAR(4);
DECLARE Codcol_w VARCHAR(2);
DECLARE Talla_w VARCHAR(3);

    If pCodloc Is Not Null Then
       SET Codloc_w = CONCAT(Upper(pCodloc),'%') ;
    End If ;

    If pCodpro Is Not Null Then
       SET Codpro_w = CONCAT(Upper(pCodpro),'%') ;
    End If ;

    If pCodart Is Not Null Then
       SET Codart_w = CONCAT(Upper(pCodart),'%') ;
    End If ;
    
    If pCodcol Is Not Null Then
       SET Codcol_w = CONCAT(Upper(pCodcol),'%') ;
    End If ;
    
    If pTalla Is Not Null Then
       SET talla_w = CONCAT(Upper(pTalla),'%') ;
    End If ;
    
    Select inv_codloc  codloc,
           loc_nombre  nomloc,
           inv_codpro  codpro,
           pro_nomfa   nomfa,
           inv_codart  codart,
           art_nomart  nomart,
           inv_codcol  codcol,
           col_nomcol  nomcol,
           inv_talla   talla,
           inv_saldo   saldo,
           inv_ultpre  ultpre,
           date_format(inv_fecpre, '%d/%m/%Y')  fecpre,
           inv_factura factura,
           inv_fisico  fisico,
           inv_prevta  prevta
            
          From cam_inventario  
          Left Join cam_locales  
            On inv_codloc = loc_codloc 
          Left Join cam_proveedores  
            On inv_codpro = pro_codpro 
          Left Join cam_articulos
            On inv_codpro = art_codpro and inv_codart = art_codart 
          Left Join cam_colores  
            On inv_codcol = col_codcol 
          
         Where Upper(inv_codloc)   Like IFNULL( Codloc_w, Upper(inv_codloc) )
           And Upper(inv_codpro)   Like IFNULL( Codpro_w, Upper(inv_codpro) )
           And Upper(inv_codart)   Like IFNULL( Codart_w, Upper(inv_codart) )
           And Upper(inv_codcol)   Like IFNULL( Codcol_w, Upper(inv_codcol) )
           And Upper(inv_talla)   Like IFNULL( talla_w, Upper(inv_talla) )
          
        Order By codloc,codpro,codart,codcol,talla ;

    
END$$

