CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_psel_num_vales`(
       IN pCodloc VARCHAR(2),
          pFecha Date)
BEGIN

     SELECT MIN(c.cve_numtra)     valini,
            MAX(c.cve_numtra)     valfin
           
           
      FROM cam_cabventa     c
          
    WHERE c.cve_codloc  = IFNULL(pCodloc, c.cve_codloc)
    And c.cve_fectra = IFNULL( pFecha, c.cve_fectra );

      


END$$

