CREATE DEFINER=`root`@`localhost` PROCEDURE `CAM_PSEL_USUARIO_SISTEMA`(
       IN pSistema VARCHAR(4), 
          pUsuario VARCHAR(10))
BEGIN

		SELECT s.csistema     sistema,
           s.cusuario     usuario,
           u.crut         persona,
           u.nnombres     nombres,
           u.npaterno     paterno,
           u.nmaterno     materno,
           s.tpassword    password,
           date_format(s.ffecha_pass, '%d/%m/%Y')  fecha_pass,
           s.qduracion    duracion,
           date_format((s.ffecha_pass + s.qduracion), '%d/%m/%Y') expira,
           s.mhabilitado  habilitado,
           s.ctipo        tipo
           
      FROM cam_usuario_sistemas s,
           cam_usuarios         u
           
	WHERE s.csistema = pSistema
	  AND trim(s.cusuario) = trim(IFNULL(pUsuario, s.cusuario))
	  AND u.cusuario = s.cusuario
      Order By u.npaterno, u.nmaterno, u.nnombres ;


END$$

