        `ven_direcc`  direcc,
        `ven_ciudad`  ciudad,
        `ven_fono`    fono,
        `ven_porcom`  porcom,
        `ven_pordes`  pordes,
        `ven_marenv`  marenv
             
         From cam_vendedores     
                     
         Where Upper(ven_codven)  Like IFNULL( cod_w, Upper(ven_codven) )
              
            Order By ven_nombre ;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_psel_vtasxfecha`(
       IN pCodloc VARCHAR(2),
          pFechad Date,
          pFechah Date)
BEGIN

     SELECT c.cve_numtra  numtra,
           c.cve_transa   transa,
           c.cve_codven   codven,
           v.ven_nombre   nomven,
           c.cve_activo   activo,
           c.cve_total         total,
           COUNT(f.fpa_formpa)  cantfp,
           f.fpa_formpa     fpago
           
      FROM cam_cabventa     c
         Inner join cam_vendedores    v
              On v.ven_codven = c.cve_codven 
         Inner join cam_formpago f
           On f.fpa_codloc = c.cve_codloc
              and f.fpa_numtra = c.cve_numtra 
          
    WHERE c.cve_codloc  = IFNULL(pCodloc, c.cve_codloc)
    And c.cve_fectra >= IFNULL( pFechad, c.cve_fectra )
    And c.cve_fectra <= IFNULL( pFechah, c.cve_fectra )

      Group By c.cve_numtra

      Order By c.cve_numtra;
      


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_psel_vtasxfpago`(
       IN pCodloc VARCHAR(2),
          pFecha Date)
BEGIN

     SELECT f.fpa_formpa     fpago,
          SUM(f.fpa_monto)   totfp
           
           
      FROM cam_cabventa     c
         Inner join cam_formpago f
           On f.fpa_codloc = c.cve_codloc
              and f.fpa_numtra = c.cve_numtra 
          
    WHERE c.cve_codloc  = IFNULL(pCodloc, c.cve_codloc)
    And c.cve_fectra = IFNULL( pFecha, c.cve_fectra )
    And c.cve_activo = 'S'

      Group By f.fpa_formpa

      Order By f.fpa_formpa;
      


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_psel_vtasxtipo`(
       IN pCodloc VARCHAR(2),
          pFecha Date)
BEGIN

     SELECT c.cve_activo     activo,
          COUNT(c.cve_activo)   totval
           
           
      FROM cam_cabventa     c
          
    WHERE c.cve_codloc  = IFNULL(pCodloc, c.cve_codloc)
    And c.cve_fectra = IFNULL( pFecha, c.cve_fectra )

      Group By c.cve_activo

      Order By c.cve_activo DESC;
      


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_psel_vtasxtransa`(
       IN pCodloc VARCHAR(2),
          pFecha Date)
BEGIN

     SELECT c.cve_transa     transa,
          COUNT(c.cve_transa)   cant,
