                UPPER(pdirecc) , 
                UPPER(pciudad) , 
                pfono,
                pfax,
                pporcom
                 );
                            
      END IF;

   IF pmodo = 'M' THEN
   
        Select Count( 1 ) Into Aux_w
         From `camelia`.`cam_instituciones`
         Where ins_codins = pcodins;
 
        If Aux_w > 0  Then
             UPDATE `camelia`.`cam_instituciones`
                SET   ins_codins   = IFNULL(pcodins,ins_codins),
                      ins_rutins   = IFNULL(prutins,ins_rutins),
                      ins_nombre   = IFNULL(pnombre,ins_nombre),
                      ins_direcc   = IFNULL(pdirecc,ins_direcc),
                      ins_ciudad   = IFNULL(pciudad,ins_ciudad),
                      ins_fono     = IFNULL(pfono,ins_fono),
                      ins_fax     = IFNULL(pfax,ins_fax),
                      ins_porcom    = IFNULL(pporcom,ins_porcom)
                      
              Where ins_codins = pcodins;
        END IF;    
   END IF;
   
   IF pmodo = 'E' THEN
         DELETE FROM `camelia`.`cam_instituciones`
          WHERE ins_codins = pcodins;
 
   END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cam_pupd_inventario`(IN PMODO VARCHAR(1),
        PCODLOC  VARCHAR(2),
        PCODPRO VARCHAR(3),
        PCODART VARCHAR(4),
        PCODCOL VARCHAR(2), 
        PTALLA VARCHAR(3), 
        PSALDO INT(6), 
        PULTPRE INT(6), 
        PFECPRE DATE, 
        PFACTURA INT(8), 
        PFISICO INT(6),
        PPREVTA INT(6),
        PPULLA VARCHAR(1),
        PPORPRE DECIMAL(5,2),
        PMONTO INT(6),
        PFECINV DATE,
        PSTKINV INT(6)
        )
BEGIN

   IF pmodo = 'I' THEN

                `inv_codpro`,
