            VALUES
                    (
                PCODLOC ,
                PCODPRO ,
                PCODART ,
                PCODCOL , 
                PTALLA , 
                PSALDO , 
                PULTPRE , 
                PFECPRE , 
                PFACTURA, 
                PFISICO ,
                PPREVTA ,
                PPULLA ,
                PPORPRE ,
                PMONTO ,
                PFECINV ,
                PSTKINV 
                    );

    END IF;

   IF pmodo = 'M' THEN
         UPDATE cam_inventario
                SET   inv_codloc  = IFNULL(PCODLOC,inv_codloc),
                      inv_codpro  = IFNULL(PCODPRO,inv_codpro),
                      inv_codart   = IFNULL(PCODART,inv_codart),
                      inv_codcol   = IFNULL(PCODCOL,inv_codcol),
                      inv_talla  = IFNULL(PTALLA,inv_talla),
                      inv_saldo  = IFNULL(PSALDO,inv_saldo),
                      inv_ultpre    = IFNULL(PULTPRE,inv_ultpre),
                      inv_fecpre     = IFNULL(PFECPRE,inv_fecpre),
                      inv_factura  = IFNULL(PFACTURA,inv_factura),
                      inv_fisico    = IFNULL(PFISICO,inv_fisico),
                      inv_prevta     = IFNULL(PPREVTA,inv_prevta),
                      inv_pulla    = IFNULL(PPULLA,inv_pulla),
                      inv_porpre     = IFNULL(PPORPRE,inv_porpre),
                      inv_monto  = IFNULL(PMONTO,inv_monto),
                      inv_fecinv    = IFNULL(PFECINV,inv_fecinv),
                      inv_stkinv     = IFNULL(PSTKINV ,inv_stkinv)

              Where inv_codloc = PCODLOC And 
                    inv_codpro = PCODPRO And
                    inv_codart = PCODART And
                    inv_codcol = PCODCOL And
                    inv_talla = PTALLA;
   END IF;

   IF pmodo = 'E' THEN
         DELETE FROM cam_inventario
          Where inv_codloc = PCODLOC And 
                    inv_codpro = PCODPRO And
                    inv_codart = PCODART And
                    inv_codcol = PCODCOL And
                    inv_talla = PTALLA;
   END IF;

